  function saveStats(player, stats) {
    const authKey = player.auth || player.conn;
    localStorage.setItem(authKey, JSON.stringify(stats));
  }

  function loadStats(player) {
    const authKey = player.auth || player.conn;
    const stats = localStorage.getItem(authKey);
    return stats ? JSON.parse(stats) : [0, 0, 0, 0, "0.00", 0, 0, 0, 0, "0.00", "player", player.name];
  }


  function getBallSpeed() {
      var lastBallInfo = extendedP.filter(p => p[3])[0];
      
      // Verificar si hay información de posición anterior
      if (!lastBallInfo || !lastBallInfo[4]) {
          return 0;
      }
  
      var ball = room.getBallPosition();
      var lastBall = lastBallInfo[4];
      var time = Date.now() - lastBallInfo[5];
      
      if (time === 0) {
          return 0;
      }
  
      var vx = (ball.x - lastBall.x) / time;
      var vy = (ball.y - lastBall.y) / time;
  
      return Math.sqrt(vx * vx + vy * vy);
  }
  
