  /* PLAYER ACTIVITY */
  
  room.onPlayerChat = function (player, message) {
      // Verificar si el mensaje comienza con "!"
      if (message.startsWith("!")) {
          var command = message.split(" ");
          handleCommand(command, player);
          return false; // Evitar que el mensaje se muestre en el chat
      }
  
      // Mensajes de equipo
      if (message.startsWith("t ")) {
          teamMsg = message.substring(2).trim(); // Cambiado a partir del segundo carácter
          if (player.team == 1) {
              var players = room.getPlayerList().filter((teamPlayer) => teamPlayer.team == 1);
              players.forEach(function (teamPlayer) {
                  room.sendAnnouncement("[🔴] " + player.name + ": " + teamMsg, teamPlayer.id, 0xED6A5A, "normal", 1);
              });
          } else if (player.team == 2) {
              var players = room.getPlayerList().filter((teamPlayer) => teamPlayer.team == 2);
              players.forEach(function (teamPlayer) {
                  room.sendAnnouncement("[🔵] " + player.name + ": " + teamMsg, teamPlayer.id, 0x5995ED, "normal", 1);
              });
          } else if (player.team == 0) {
              var players = room.getPlayerList().filter((teamPlayer) => teamPlayer.team == 0);
              players.forEach(function (teamPlayer) {
                  room.sendAnnouncement("[🔘] " + player.name + ": " + teamMsg, teamPlayer.id, 0x9AADAA, "normal", 1);
              });
          }
          return false;
      }
  
      // Mensajes privados
      if (message.startsWith("@@")) {
          // ... (Código anterior)
          return false;
      }
  };
  
  
  const ADMIN_PASSWORD = adminPassword;
  const ANNOUNCE_COLOR_SUCCESS = 0x00ff00;
  const ANNOUNCE_COLOR_ERROR = 0xFA5646;
  
  function handleCommand(command, player) {
      const [cmd, ...args] = command;
  // Verifica si el jugador es administrador
  const isAdmin = predefinedAdmins.some(admin => admin.auth === player.auth || admin.name === player.name);

  // Si el jugador es un administrador, agrega el prefijo [ADMIN] a su nombre
  const displayName = isAdmin ? `[ADMIN] ${player.name}` : player.name;
      switch (cmd.toLowerCase()) {
          case "!admin":
              handleLogin(args, player);
              break;
              case "!ayuda":
              if(player) room.sendAnnouncement(`🤖[PV] COMANDOS: !jiro,!discord,!enle,!x1nogol,!X1 ,!X3, !X4,!X5,!X7,!swap,!rr,!clearbans`, null, ANNOUNCE_COLOR_SUCCESS, 2);
              break;
              case "!discord":
                  if(player)room.sendAnnouncement("Discord: https://discord.gg/aD9CKzaqY7", player.id, 0xf70000, "bold");
                  room.sendAnnouncement(`UNETE YA E INSCRIBE A TU EQUIPO EN ESTA GRAN LIGA`, player.id, 0xf70000, "bold");
                  break;
          case "!rr":
              if (player.admin) handleRestart(player);
              break;
          case "!swap": 
              if (player.admin) handleSwapTeams(player);
              break;
          case "!clearbans":
              if (player.admin) handleClearBans(player);
              break;
          case "!enle":
              if (player.admin) handleMapChange(player, practice, "Entrenamiento", 2);
              break;
          case "!x3":
              if (player.admin) handleMapChange(player, futsalx3, "Futsal x3 ENLE", 2);
              break;
          case "!x1":
              if (player.admin) handleMapChange(player, futsalx1, "Futsal x1 ENLE", 1);
              break;
           case "!x4":
              if (player.admin) handleMapChange(player, futsalx4, "Futsal x4 ENLE", 0);
              break;
          case "!claim":
              handleSinglePlayerAdmin(player);
              break;
              case "!x1nogol":
                  if (player.admin) handleMapChange(player, futsalx1NoGoals, "Futsal x1 no goals", 2);
                  break;
                  case "!x5":
                  if (player.admin) handleMapChange(player, futsalx5, "Futsal x5 ENLE", 2);
                  break;
                  case "!x7":
                  if (player.admin) handleMapChange(player, futsalx7, "Futsal x7 ENLE", 2);
                  break;
                  case "!jiro":
                  if(player)room.sendAnnouncement("¿Donde esta Jiro ?🤔", player.id, 0xf70000, "bold");
                  
                  break;
          default:
              room.sendAnnouncement("[❌] Comando no reconocido.", player.id, ANNOUNCE_COLOR_ERROR, "bold", 2);
      }
  }
  
  function handleLogin(args, player) {
      if (args[0] === ADMIN_PASSWORD) {
          room.setPlayerAdmin(player.id, true);
          room.sendAnnouncement(`${player.name} ingresó como Administrador!`, null, ANNOUNCE_COLOR_SUCCESS, 2);
          let stats = JSON.parse(localStorage.getItem(getAuth(player))) || [0, 0, 0, 0, "0.00", 0, 0, 0, 0, "0.00", "player", player.name];
          if (stats[10] !== "master") {
              stats[10] = "master";
              room.sendAnnouncement(`${player.name} ingresó como Administrador!`, null, ANNOUNCE_COLOR_SUCCESS, 2);
              localStorage.setItem(getAuth(player), JSON.stringify(stats));
          }
      } else {
          room.sendAnnouncement("[❌] Contraseña incorrecta.", player.id, ANNOUNCE_COLOR_ERROR, "bold", 2);
      }
  }
  
  function handleSinglePlayerAdmin(player) {
    // Obtener la lista de jugadores (excluyendo al bot con id 0)
    let players = room.getPlayerList().filter((p) => p.id !== 0);

    // Verificar si ya hay algún administrador en la sala
    const hasAdmin = players.some((p) => p.admin);

    if (!hasAdmin) {
        // Si no hay administradores, promover al jugador a administrador
        room.setPlayerAdmin(player.id, true);

        // Cargar estadísticas del jugador
        let stats = loadStats(player);

        // Verificar y actualizar el rol del jugador en las estadísticas
        if (stats[10] !== "master") {
            stats[10] = "master"; // Cambiar el rol del jugador a "master"
            saveStats(player, stats); // Guardar las estadísticas actualizadas
        }

        room.sendAnnouncement(
            `${player.name} ahora es Administrador.`,
            null,
            0x00ff00,
            "bold",
            2
        );
    } else {
        // Si ya hay un administrador, mostrar un mensaje al jugador
        room.sendAnnouncement(
            "Solo puedes ser administrador si no hay otro administrador en la sala.",
            player.id,
            0xff0000,
            "bold",
            2
        );
    }
}

  
  function handleRestart(player) {
      room.stopGame();
      room.startGame();
      room.sendAnnouncement(`[✅] ${player.name} reinició el partido.`, null, ANNOUNCE_COLOR_SUCCESS, "bold", 2);
  }
  
  function handleSwapTeams(player) {
      let players = room.getPlayerList().filter((p) => p.id != 0);
      players.forEach((p) => {
          room.setPlayerTeam(p.id, p.team == 1 ? 2 : 1);
      });
      room.sendAnnouncement(`[🔄] Los equipos fueron cambiados de lado por ${player.name}.`, null, ANNOUNCE_COLOR_SUCCESS, "bold", 2);
  }
  
  function handleClearBans(player) {
      room.clearBans();
      room.sendAnnouncement(`[✅] ${player.name} borró los baneos.`, null, ANNOUNCE_COLOR_SUCCESS, "bold", 2);
  }
  
  function handleMapChange(player, stadium, mapName, mapIndex) {
      room.stopGame();
      room.setCustomStadium(stadium);
      room.startGame();
      mapSelect = mapIndex;
      room.sendAnnouncement(`[✅] ${player.name} cambió el mapa a '${mapName}'`, null, ANNOUNCE_COLOR_SUCCESS, "bold", 2);
  }
  
  
  
